// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Shopping from './components/Shopping';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Shopping />} />
      </Routes>
    </Router>
  );
};

export default App;
